	/** 
	 * In order to get the queue connection factory
	 *  
	 * <br><b>Known Bugs</b><br> 
	 * 
	 * <br><PRE> 
	 * date Nov 24, 2003 
	 * 
	 * revision date author reason 
	 * 
	 * </PRE><br> 
	 * 
	 * @return QueueConnectionFactory
	 */
	private Object getObjectByJNDILookup(String jndiName, boolean isQueueConnectionFactory) throws Exception
	{
		Object returnObject = null;

		if (isQueueConnectionFactory)
		{
			returnObject = ServiceLocator.getJMSObjectFactory().getQueueConnectionFactory(jndiName);
		}
		else
		{
			returnObject = ServiceLocator.getJMSObjectFactory().getQueue(jndiName);
		}

		return returnObject;
	}

	private String sendAndReceive(String messageString) throws Exception
	{
		String returnString = null;

		try
		{
			returnString = sendAndReceiveMessage(messageString);
		}
		catch (JMSException e)
		{
			try
			{
				handleException(e, false);

				// Retry to connect again
				returnString = sendAndReceiveMessage(messageString);
			}
			catch (JMSException ex)
			{
				handleException(ex, true);
			}
		}

		return returnString;
	}

	private String sendAndReceiveMessage(String messageString) throws Exception
	{
		String returnString = null;
		QueueSession session = null;
		QueueConnectionFactory connectionFactory = null;

		try
		{
			if (connection == null)
			{
				// QueueConnectionFactory connectionFactory = (QueueConnectionFactory) getObjectByJNDILookup(CONNECTION_FACTORY_JNDI_NAME, true);
				connectionFactory = (QueueConnectionFactory) getObjectByJNDILookup(OPPTPropertiesReader.getQueueConnectionFactory(), true);

				connection = connectionFactory.createQueueConnection();
			}					
			try {
				connection.start();
			}catch(Exception e) {
				//Added by balaji to fix the closed connection exception.
				connectionFactory = ServiceLocator.getJMSObjectFactory().resetQueueConnectionFactory();
				connection = connectionFactory.createQueueConnection();
				connection.start();
			}

			session = connection.createQueueSession(false, Session.AUTO_ACKNOWLEDGE);

			String messageSelector = sendMessage(session, messageString);
			returnString = receiveMessage(session, messageSelector);

			return returnString;
		}
		catch (JMSException ex)
		{
			throw ex;
		}
		finally
		{
			if (session != null)
			{
				session.close();
			}
		}
	}

	private void handleException(JMSException ex, boolean isTriedToReconnect) throws Exception
	{
		String errorCode = ex.getMessage();
		String methodName = "handleException";

		if (ex.getLinkedException() != null)
		{
			errorCode = ex.getLinkedException().getMessage();
		}

		boolean canThrowException = true;

		if (errorCode.indexOf(ErrorCodeConstants.MQ_QUIESING) > -1)
		{
			OPPTLogger.log("MQ_QUIESING", OPPTLogger.ERROR, CLASS_NAME, methodName, null, ex);
		}
		else if (errorCode.indexOf(ErrorCodeConstants.MQ_SHUTTING_DOWN) > -1)
		{
			OPPTLogger.log("MQ_SHUTTING_DOWN", OPPTLogger.ERROR, CLASS_NAME, methodName, null, ex);
		}
		else if (errorCode.indexOf(ErrorCodeConstants.MQ_KILLED) > -1)
		{
			OPPTLogger.log("MQ_KILLED", OPPTLogger.ERROR, CLASS_NAME, methodName, null, ex);
		}
		else if (errorCode.indexOf(ErrorCodeConstants.MQ_CONNECTION_BROKEN) > -1)
		{
			if (isTriedToReconnect)
			{
				OPPTLogger.log("MQ_CONNECTION_BROKEN", OPPTLogger.ERROR, CLASS_NAME, methodName, null, ex);
			}
			else
			{
				OPPTLogger.log("MQ_RECONNECTION_ON_BROKEN", OPPTLogger.ERROR, CLASS_NAME, methodName, null, ex);
				canThrowException = false;

				connection = null;
				senderQueue = null;
				receiverQueue = null;
			}
		}

		if (canThrowException)
		{
			throw ex;
		}
	}

	private String sendMessage(QueueSession session, String messageString) throws Exception
	{
		QueueSender sender = null;

		try
		{
			if (senderQueue == null)
			{
				// senderQueue = (Queue) getObjectByJNDILookup(QUEUE_SENDER_JNDI_NAME, false);
				senderQueue = (Queue) getObjectByJNDILookup(OPPTPropertiesReader.getSenderQueue(), false);
			}

			sender = session.createSender(senderQueue);
			sender.setDeliveryMode(DeliveryMode.NON_PERSISTENT);

			TextMessage message = session.createTextMessage();
			message.setJMSMessageID(MESSAGE_ID);
			message.setText(messageString);

			sender.send(message);
			String messageID = message.getJMSMessageID();

			OPPTLogger.log("JMS_MESSAGE_SEND", OPPTLogger.INFO, CLASS_NAME, "sendMessage", message.getText());

			return messageID;
		}
		catch (JMSException e)
		{
			throw e;
		}
		finally
		{
			if (sender != null)
			{
				sender.close();
			}
		}
	}

	private String receiveMessage(QueueSession session, String messageSelector) throws Exception
	{
		QueueReceiver receiver = null;
		try
		{
			messageSelector =
				new StringBuffer().append("JMSCorrelationID = \'").append(messageSelector).append("\'").toString();

			if (receiverQueue == null)
			{
				// receiverQueue = (Queue) getObjectByJNDILookup(QUEUE_RECEIVER_JNDI_NAME, false);
				receiverQueue = (Queue) getObjectByJNDILookup(OPPTPropertiesReader.getReceiverQueue(), false);
			}

			receiver = session.createReceiver(receiverQueue, messageSelector);

			TextMessage msg = (TextMessage) receiver.receive();

			String returnString = msg.getText();

			OPPTLogger.log("JMS_MESSAGE_RECEIVE", OPPTLogger.INFO, CLASS_NAME, "receiveMessage", returnString);

			return returnString;
		}
		catch (JMSException e)
		{
			throw e;
		}
		finally
		{
			if (receiver != null)
			{
				receiver.close();
			}
		}
	}
